      // minimise diff in ouput from svgomg
      // maybe remove in future? will produce smaller output
      convertToZ: false,
      removeUseless: false,
    }
  })),
  {
    name: 'addTrailingWhitespace',
    fn() {
      return {
        root: {
          exit (root) {
            root.children.push({ type: 'text', value: '\n' })
            return root
          }
        }
      }
    }
  }]
};

